import React, { useState } from 'react'
import FooterImg from '../assets/footer.webp'
import styled from 'styled-components'
import ReCAPTCHA from 'react-google-recaptcha';
import { FontAwesomeIcon } from '@fortawesome/react-fontawesome';
import { faHeart } from '@fortawesome/free-solid-svg-icons';

const Container = styled.footer`
    margin-top: 5em;
    padding: 0 4em;
    // padding-bottom: 3em;
    // padding-top: 25em;
    position: relative;
    max-width: 100%;
    display: flex;
    flex-direction: column;

    &:before {
        background: url(${FooterImg}) no-repeat scroll bottom transparent;
        background-size: 100% 1200px;
        bottom: 0;
        content: "";
        height: 100%;
        left: 0;
        position: absolute;
        width: 100%;
        z-index: -2;
    }

    @media (max-width: 768px) {
        padding: 0 1em;
        padding-top: 10em;
        margin-top: -15em;
    }
`;

const Title = styled.h2`
    color: #fff;
    font-family: Ruberoid;
    font-weight: 700;
    margin-bottom: 20px;
    font-size: 2em;
    line-height: 1.2;

    @media (max-width: 768px) {
        font-size: 1.5em;
    }
`;

const Newsletter = styled.div`
    display: flex;
    flex-direction: column;
    gap: 1.5em;

    input {
        padding: 1em;
        border-radius: 5px;
        width: 100%;
        border: none;
        font-family: inherit;
        font-size: 1em;
    }

    button {
        background: #000;
        border: none;
        border-radius: 6px;
        color: #fff;
        font-family: Ruberoid;
        font-size: 1em;
        font-weight: 700;
        letter-spacing: .2px;
        line-height: 1.25em;
        padding: 1em 2em;
        text-align: center;
        width: max-content;
        cursor: ${({ disabled }) => (disabled ? 'not-allowed' : 'pointer')};

        &:hover {
            background: #333;
        }
    }
`;

const LowerTitle = styled.h3`
    color: #fff;
    font-family: Ruberoid;
    font-weight: 700;
    margin-bottom: 10px;
    font-size: 1.3em;
`;

const SubContainer = styled.p`
    color: #fff;
    font-size: 1em;
    line-height: 1.5;
`;

const FlexContainer = styled.div`
    display: flex;
    gap: 2em;
    flex-wrap: wrap;

    @media (max-width: 768px) {
        flex-direction: column;
        gap: 1.5em;
    }
`;

const Button = styled.button`
    border-radius: 8px;
    border: none;
    padding: .9em 1.5em;
    font-size: 1em;
    font-family: 'Ruberoid';
    font-weight: 500;
    cursor: pointer;
    background-color: #fff;
    color: #000;
    font-weight: bold;

    &:hover {
        background-color: #ebebeb;
    }
`;

const Acknowledgement = styled.p`
    text-align: center;
    color: #fff;
    font-size: .8em;
    margin-top: 1.5em;

    &.first {
        margin-top: 2em;
    }
`;

function Footer() {
    const [capVal, setCapVal] = useState(null);

    return (
        <Container>
            {/* Newsletter Section */}
            <Newsletter>
                <Title>Subscribe to our Newsletter</Title>
                <input type='email' placeholder='mail@celestia.com' />
                <ReCAPTCHA sitekey='6LeB8ZYqAAAAANAEy8OS9EjED1H--PSxkoKAddPk' onChange={val => setCapVal(val)} />
                <button disabled={!capVal}>Subscribe</button>
            </Newsletter>

            {/* Links Section */}
            <FlexContainer>
                <div>
                    <LowerTitle>Developers</LowerTitle>
                    {['Build', 'Docs', 'Github', 'FAQ'].map((list) => (
                        <SubContainer key={list}>{list}</SubContainer>
                    ))}
                </div>
                <div>
                    <LowerTitle>Resources</LowerTitle>
                    {['Technology', 'Glossary', 'Blog', 'Podcast', 'Resources'].map((list) => (
                        <SubContainer key={list}>{list}</SubContainer>
                    ))}
                </div>
                <div>
                    <LowerTitle>Misc</LowerTitle>
                    {['Brand', 'Press', 'Careers', 'Terms of Service', 'Privacy Policy'].map((list) => (
                        <SubContainer key={list}>{list}</SubContainer>
                    ))}
                </div>
                <div>
                    <LowerTitle>Follow us</LowerTitle>
                    <Button>View socials</Button>
                </div>
            </FlexContainer>

            {/* Acknowledgement */}
            <Acknowledgement className='first'>This website is not maintained by Celestia Labs.</Acknowledgement>
            <Acknowledgement>Website designed with <FontAwesomeIcon icon={faHeart} /> by SI</Acknowledgement>
        </Container>
    );
}

export default Footer;
